import PropTypes from 'prop-types';
import Table from '../shared/Table/Table';

const History = props => {
    return (
        <Table>
            <Table.Column title={'Name'} dataIndex={'name'} />
            <Table.Column title={'adress'} dataIndex={'address'} />
        </Table>
    );
};

History.propTypes = {};

export default History;
